{
  "advertisements": [
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "26. Bey Hrn. Rudolf Kampferger an der Huths-gaf ist extra guter Holländer-Tabak in blener, nen Pfund Wüschlein zu 10 Sagen, wie auch gater St. Vincent à 8 fl. zu haben."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "27. Wo guter Art große Bohnen zum Seegen, und kleine weisse bito zum Kochen in billigem Preis zu haben, ift im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "28. Ein Stok Heu ab Thanem Matten vorm Nicdemer, Thor oberhalb der Eckhorenbruct, Ferner ein Stüklein Heu von 7 Saumen rothen Völliger Wein von 1760. Ift roth-und lauter, im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "29. Auf E. E. Junft zum Bären fubd wiederum neue Saure Rüben in billigem Preis zu haben."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "30. Ein roth Scharlachen Camifol und Hosen in billigem Preis ift zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "31. Im Offenburger-Hof ist wohlverwahrter Brennholz zu haben."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "32. Ein Brennbeislein bey der Steinen-Mühlin mit aller Kommligkeit, im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "33. Bey weite rother und weisser Burgamber, wie auch Ufkat-Wein, Zicentweis wegen Mangel Wieszen, ift roth und weisser Marggrafer-Wein in billigem Preis zu haben, im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "34. Kleine hellergetbe Hamburger-Grief-Wollen à Pfund zu 6 flund zu diefem Wundweis zu haben, ift im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "35. Gersten Holzach des Eiegifts Behaufung ins Epig's-glaßlein mit 4 Stuben, 3 Kammern 2c. ift entweder zu verkauffen, oder fametbaft zu verlethen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "36. Waife und rothe Marggrafer-Weine von 1760. wovon in billigem Preis nach Belieben zu haben, im Berichthaus zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "37. Ein Männlein in St. Peters Kirch auf dem Petner. Ift ein grün Lombardu = Bethlein mit grünen wollenen Umhängen, in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "38. Ein Hausschlitten mit einem fchönen Bild und Zugehörd in billigem Preis, im Berichte haus zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "39. Der Bärenfelfer-hof zu St. Peter, mit Garten, Stallung, Keller 2c. wie der Augens fchein zeigen wird. In Ermanglung eines Käufers"
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "18. Srey Bartenlein oder Probeher-Stüklein, huth, mittelmäßiger Größe, im Berichthaus zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "19. Bey Hrn. Burkhardt zum Riefen find extra neue große Italiänische Feigen, bito große Meerträuben mit und ohne Stiel, haidlnuf, dürre Morcheln, feiner Chocolade, alles in billigem Preis zu haben."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "20. Zwölf Säck neuer Waitzen in billigem Preis, im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "21. Bey Hrn. Jacob Grimm Buchbinder haben: Ein Kriegs-Atlas von 65 Stück Land-karten, Stätten, Plans von Bataillen und Belagerungen des jetzigen Kriegs in der Welt in einer Ruh mit Kupfern. Durchlauchtige Welt, 4 Theil mit Kupfern. 4) Journal du Lamp de Compiegne avec figures."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "22. Srey faubere franckfurter-Bether im Haus auf das Land oder in ein Bad dienlich, ohmentgeltlich im Berichthaus zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "23. Eine Behaufung in der Äschmerer Vorstadt mit 4 Stuben, 5 Kammern famt einem fchönen gewölbten Keller und Garten, westhalb Hrn. Jacob Mägklin dem Weinmann anzuzeigen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "24. Ein Freund, welcher circa 600 Sehler Hanf-Saamen anhero liefern könte, möchte aber folden vorhero verkauft wiffen, offerirt felbigen dabero in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "25. 2 guter alter weiffer Wein zu haben, ift bey Wir. Michael Fuchs dem Stiefer zu vernehmen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "",
      "text": "26. Circa 6. Saum extra guter alter nur rother Pfälzer-Wein, fo gut als Neuemberger oder Burgunder, in billigem Preis, im Berichthaus zu erfragen."
    }
  ]
}
